        </va-card-content>
      </va-card>
    </div>
  </div>
</template>

<script setup lang="ts">
  import { ref } from 'vue'
  import { useI18n } from 'vue-i18n'
  import axios from 'axios'
  const { t } = useI18n()

  const advancedGallery = ref([])
  const colors = ref(['success', 'info', 'danger', 'warning', 'gray', 'dark'])

  const popover = ref({
    color: 'warning',
  })

  const submitRequest = async () => {
    const requestBody = {
