      negative_prompt:
        '(deformed, distorted, disfigured:1.3), poorly drawn, bad anatomy, wrong anatomy, extra limb, missing limb, floating limbs, (mutated hands and fingers:1.4), disconnected limbs, mutation, mutated, ugly, disgusting, blurry, amputation, watermark, (deformed, distorted, disfigured:1.3), poorly drawn, bad anatomy, wrong anatomy, extra limb, missing limb, floating limbs, (mutated hands and fingers:1.4), disconnected limbs, mutation, mutated, ugly, disgusting, blurry, amputation, watermark',
      seed: -1,
      batch_size: 1,
      n_iter: 1,
      steps: 20,
      cfg_scale: 7,
      width: 512,
      height: 768,
      restore_faces: false,
      tiling: false,
      eta: 0,
      script_args: [],
      sampler_index: 'DPM++ SDE Karras',
      init_images: [
        `
        
        
        
        
        
        `,
      ],
      mask: '',
      resize_mode: 1,
      denoising_strength: 0.7,
      mask_blur: 10,
      inpainting_fill: 1,
      inpaint_full_res: 0,
      inpaint_full_res_padding: 32,
      inpainting_mask_invert: 1,
      alwayson_scripts: {
        ControlNet: {
          args: {
            enabled: true,
            module: 'none',
            model: 'control_openpose-fp16 [9ca67cc5]',
            weight: 1,
            image:
              '',
            mask: null,
            invert_image: false,
            resize_mode: 0,
            rgbbgr_mode: false,
            lowvram: false,
            processor_res: 0,
            threshold_a: 64,
            threshold_b: 64,
            guidance_start: 0,
            guidance_end: 1,
            guessmode: false,
          },
        },
      },
    }

    try {
      const response = await axios.post('/api/sdapi/v1/img2img', requestBody)
      console.log('Response:', response.data)
    } catch (error) {
      console.error('Error:', error)
    }
  }
</script>
